import axios from "axios";

const apiUrl = "http://localhost:5000";

export const getAllPermissions = async () => {
  try {
    const res = await axios.get(`${apiUrl}/permissions`);

    return res.data;
  } catch (err) {
    console.error(err);
  }
};
